import './App.css';
import React from 'react';
import Login from './login';
import Register from './register';
import Welcome from './welcome';
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App">
    <div class="container">
      <div id="intro" class="bg-image shadow-2-strong">
      <div class="mask" style={{backgroundColor: "rgba(0, 0, 0, 0.8)"}} >
        <div class="container d-flex align-items-center justify-content-center text-center h-100">
          <div class="text-white">
            <h1 class="mb-3">PetLand</h1>
            <h5 class="mb-4">A platfrom where petlovers meet</h5>
            <a class="btn btn-outline-light btn-lg m-2" href="https://www.youtube.com/watch?v=c9B4TPnak1A" role="button"
              rel="nofollow" >Start tutorial</a>
            <a class="btn btn-outline-light btn-lg m-2" href="https://mdbootstrap.com/docs/standard/" 
              role="button">Download MDB UI KIT</a>
          </div>
        </div>
      </div>
    </div>
    </div>
      <Switch>
      <Route path="/" exact component={Welcome} />
      <Route path="/login" component={Login} />
      <Route path="/register" component={Register} />
      </Switch>
    </div>
    </Router>
  );
}

export default App;
